import React from "react";
import './toDoList.css';

class Button extends React.Component {
    
   
    sendToConsole = () => {
        console.log('finished Task ');
    }
    render() {

        return (
            <button onClick={this.sendToConsole} className="btn">Count finished Tasks</button>
        )
    }

}

export default Button;
